commitMessage:
led: Add GetSubTree method to get service name

Use the GetSubTree method of mapper to get the corresponding
service name instead of `hard-code`.

Tested: if enclosure_identify_blink not present but
enclosure_identify is present:

curl -k -H "X-Auth-Token: $token" https://${bmc}/redfish/v1/Systems/system
{
  "@odata.id": "/redfish/v1/Systems/system",
  "@odata.type": "#ComputerSystem.v1_13_0.ComputerSystem",
  "Actions": {
    "#ComputerSystem.Reset": {
      "@Redfish.ActionInfo": "/redfish/v1/Systems/system/ResetActionInfo",
      "target": "/redfish/v1/Systems/system/Actions/ComputerSystem.Reset"
    }
  },
  "LocationIndicatorActive": false,
  ...
}

Signed-off-by: George Liu <liuxiwei@inspur.com>
